                          style: "currency",
                          currency: "VND",
                        })}
                      </p>
                    </div>
                    <div className="location-car">
                      <i>
                        {" "}
                        <GoLocation />
                      </i>
                      <p>{data.location}</p>
                    </div>
                  </di>
                </div>
              );
            })}
          </div>
        </div>
